import React from 'react';

export default function Dashboard() {
  return (
    <div className="p-8 bg-gray-50 min-h-screen">
      <h1 className="text-3xl font-bold mb-6">Bem-vindo ao Painel do Aluno</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <div className="bg-white p-4 rounded shadow">
          <h2 className="font-bold mb-2">Curso de Nutrição Básica</h2>
          <p>Acompanhe as aulas e complete os módulos.</p>
        </div>
        <div className="bg-white p-4 rounded shadow">
          <h2 className="font-bold mb-2">Mentorias</h2>
          <p>Agende suas sessões com o nutrólogo.</p>
        </div>
      </div>
    </div>
  );
}
